import css from "styled-jsx/css";

export default <style>{`
body{
    margin:10px;
    padding:5px;
    color:#669;
}
header{
    font-size:64pt;
    font-weight:bold;
    text-align:right;
    letter-apacing:-8px;
    color:#ddddff;
    margin:-32pt 5px;
 }
 footer{
     color:#99C;
     font-size:12pt;
     text-align:right;
     border-bottom:1px solid #99C;
     margin:50px 0px 10px 0px;
     position:relative;
     bottom:10px;
     right:10px;
     left:10px;
 }
 hl{
     font-size:22pt;
     font-weight:bold;
     text-align:left;
     letter-spacing:0px;
     color:#77a;
     margin:-50px 0px 50px 0px;
 }
 p{
     margin:0px;
     color:#669;
     font-size:16pt;
 }
 hr{
     margin:25px 0px;
 }
 tr{
     margin:0px;
 }
 th{
     font-size:14pt;
     font-weight:plain;
     text-align:right;
     padding:0px 20px;
     margin:0px;
     border-bottom:1px solid gray;
 }

    `}</style>
